static String toDisplaySize(long size) {
  if (size < 1024) {
    return String.valueOf(size) + " B";
  } else if (size < 1048576) {
    return String.valueOf(size / 1024) + " KB";
  } else {
    return String.valueOf(size / 1048576) + " MB";
  }
}

